import { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

export function Routing() {
    
  return (
    <Routing>
      <div>
        {/* Navigation Bar */}
        <nav>
          <ul>
            <li>
              <Link to="/get">GET</Link>
            </li>
            <li>
              <Link to="/getid">Get by Id</Link>
            </li>
          </ul>
        </nav>
      </div>
    </Routing>
  );
}

export default Routing;
